TITLE:
  - PRELIMINARY investigations for the design of the experiment of TP D9 of the
  - 'SFB-TRR40: design of a Plexiglas channel loaded by a heatflux on the inner side'
  - compared to design simulation the present mesh (nightly test) is quite coarse
  - 'number of elements in directions: x,y,z = 17,36,1'
  - curve fitting of E(T) using a polynom of order 6
  - 'polynom valid ONLY for temperatures between [50 degrees celsius,80 degrees celsius], according to
    experimental data'
  - 'K.F. Lei, W.J. Li, Y. Yam (2004):'
  - '"Effects of contact-stress on hot-embossed PMMA microchannel wall profile"'
  - 'chosen units: [m,kg, degrees celsius,s]'
  - 'stationary solution:'
  - 'STRUCTURE DIS structure NODE 433 QUANTITY dispx VALUE 0 TOLERANCE 1e-9 NAME ux(-3.5,0,0)'
  - 'STRUCTURE DIS structure NODE 433 QUANTITY dispy VALUE 0 TOLERANCE 1e-9 NAME uy(-3.5,0,0)'
  - 'STRUCTURE DIS structure NODE 433 QUANTITY dispz VALUE 0 TOLERANCE 1e-9 NAME uz(-3.5,0,0)'
  - 'STRUCTURE DIS structure NODE 421 QUANTITY dispx VALUE 3.00175106779087544e-04 TOLERANCE 1e-9 NAME
    ux(3.5,30,0)'
  - 'STRUCTURE DIS structure NODE 141 QUANTITY dispx VALUE -2.00898687345515845e-04 TOLERANCE 1e-9 NAME
    ux(8.5,35,0)'
  - 'THERMAL DIS thermo NODE 433 QUANTITY temp VALUE 79.9973213105214143 TOLERANCE 1.0e-8 NAME T(-3.5,0,0)'
  - 'THERMAL DIS thermo NODE 421 QUANTITY temp VALUE 79.9836533624902302 TOLERANCE 1.0e-8 NAME T(3.5,30,0)'
  - 'THERMAL DIS thermo NODE 141 QUANTITY temp VALUE 72.1374787600902448 TOLERANCE 1.0e-8 NAME T(8.5,35,0)'
  - The TSI block matrix is merged to enable the use of a direct solver for the
  - monolithic system.
